// Criação do objeto Produto, do qual está formatado para o framework

export default class Produto {
    // Construtor do objeto
    constructor (nome,imagem,descricao ){
        this.nome = nome;
        this.imagem = imagem;
        this.descricao = descricao;
    }
}
